import React, { useEffect, useState } from "react";
import axios from "axios";

const API_URL = "http://localhost:8080/api/contract-types";

export default function ContractTypeManagement() {
  const [contractTypes, setContractTypes] = useState([]);
  const [form, setForm] = useState({ name: "", code: "", description: "" });
  const [editingId, setEditingId] = useState(null);
  const [error, setError] = useState("");
  const [message, setMessage] = useState("");

  useEffect(() => {
    loadContractTypes();
  }, []);

  const loadContractTypes = async () => {
    try {
      const res = await axios.get(API_URL);
      setContractTypes(res.data);
    } catch {
      setError("Failed to load contract types.");
    }
  };

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSave = async () => {
    if (!form.name) {
      setError("Contract Type Name is required.");
      return;
    }

    try {
      if (editingId) {
        await axios.put(`${API_URL}/${editingId}`, form);
        setMessage("Updated successfully!");
      } else {
        await axios.post(API_URL, form);
        setMessage("Added successfully!");
      }

      setForm({ name: "", code: "", description: "" });
      setEditingId(null);
      loadContractTypes();
    } catch (err) {
      setError(err.response?.data || "Operation failed.");
    }
  };

  const handleEdit = (ct) => {
    setForm(ct);
    setEditingId(ct.id);
    setError("");
    setMessage("");
  };

  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure to delete this contract type?")) return;
    try {
      await axios.delete(`${API_URL}/${id}`);
      loadContractTypes();
    } catch {
      setError("Delete failed. It may have dependencies.");
    }
  };

  return (
    <div className="max-w-4xl mx-auto mt-10 p-6 bg-white shadow-md rounded">
      <h2 className="text-2xl font-bold mb-4">Contract Type Management</h2>

      {error && <p className="text-red-600">{error}</p>}
      {message && <p className="text-green-600">{message}</p>}

      <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-6">
        <input
          name="name"
          value={form.name}
          onChange={handleChange}
          placeholder="Contract Type Name"
          className="border p-2 rounded"
        />
        
        <textarea
          name="description"
          value={form.description}
          onChange={handleChange}
          placeholder="Description"
          className="border p-2 rounded col-span-1 md:col-span-2"
        />
      </div>

      <div className="flex gap-4 mb-6">
        <button
          onClick={handleSave}
          className="bg-blue-600 text-white px-4 py-2 rounded"
        >
          {editingId ? "Update" : "Add"}
        </button>
        <button
          onClick={() => {
            setForm({ name: "", code: "", description: "" });
            setEditingId(null);
            setError("");
            setMessage("");
          }}
          className="bg-gray-300 px-4 py-2 rounded"
        >
          Cancel
        </button>
      </div>

      <table className="w-full border mt-4">
        <thead className="bg-gray-100">
          <tr>
            <th className="border p-2">Name</th>
            <th className="border p-2">Code</th>
            <th className="border p-2">Description</th>
            <th className="border p-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {contractTypes.map((ct) => (
            <tr key={ct.id}>
              <td className="border p-2">{ct.name}</td>
              <td className="border p-2">{ct.code}</td>
              <td className="border p-2">{ct.description}</td>
              <td className="border p-2 flex gap-2">
                <button
                  onClick={() => handleEdit(ct)}
                  className="bg-yellow-400 px-2 py-1 rounded"
                >
                  Edit
                </button>
                <button
                  onClick={() => handleDelete(ct.id)}
                  className="bg-red-500 text-white px-2 py-1 rounded"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
